import React from 'react'
import styled, { css } from 'styled-components'

export default function Button({ func }) {
    return (
        <div>
        <Yolo onClick={func}>
        </Yolo>
        </div>
    )
}

const Yolo = styled.button`
   ${props =>
    props.small &&
    css`
     width: 100px;
     background: red;
    `}; 
`
